import React, { useState } from 'react';
import styles from './Deep.module.css';

const Deep = () => {
  const [hedisOpen, setHedisOpen] = useState(false);
  const [feeScheduleOpen, setFeeScheduleOpen] = useState(false);

  const toggleHedis = () => {
    setHedisOpen(!hedisOpen);
    // Close Fee Schedule if open
    if (feeScheduleOpen) {
      setFeeScheduleOpen(false);
    }
  };

  const toggleFeeSchedule = () => {
    setFeeScheduleOpen(!feeScheduleOpen);
    // Close Hedis if open
    if (hedisOpen) {
      setHedisOpen(false);
    }
  };

  // Prevent closing the Hedis submenu when the cursor moves over it
  const handleHedisMenuMouseOver = () => {
    if (!hedisOpen) {
      setHedisOpen(true);
    }
  };

  return (
    <nav className={`${styles['deep-nav']} ${styles['deep-body']}`}>
      <menu className={styles['deep-menu']}>
        <li className={styles['deep-menuitem']} id="demo1">
          <menu className={styles['deep-menu']}>
            <li><a>Deep Dive Session</a></li>
            <li
              className={styles['deep-menuitem']}
              id="demo2"
              onMouseOver={handleHedisMenuMouseOver}
            >
              <a onClick={toggleHedis}>Hedis</a>
              {hedisOpen && (
                <menu className={styles['deep-menu']}>
                  <li className={styles['deep-menuitem']} id="demo3">
                    <menu className={styles['deep-menu']}>
                      <li><a>Hedis Kt(Day 1)</a></li>
                      <li><a>Hedis Kt(Day 2)</a></li>
                      <li><a>Hedis Kt(Day 3)</a></li>
                      <li><a>Hedis Kt(Day 4)</a></li>
                      <li><a>Hedis Kt(Day 5)</a></li>
                      <li><a>Hedis Kt(Day 6)</a></li>
                      <li><a>Hedis Kt(Day 7)</a></li>
                      <li><a>Hedis Kt(Day 8)</a></li>
                      <li><a>Hedis Kt(Day 9)</a></li>
                    </menu>
                  </li>
                </menu>
              )}
            </li>
            <li className={`${styles['deep-menuitem']} ${styles['custom-margin']}`} id="demo4">
              <a onClick={toggleFeeSchedule}>Fee Schedule</a>
              {feeScheduleOpen && (
                <menu className={styles['deep-menu']}>
                  <li className={styles['deep-menuitem']} id="demo5">
                    <menu className={styles['deep-menu']}>
                      <li><a>Fee Schedule Kt(Day 1)</a></li>
                      <li><a>Fee Schedule Kt(Day 9)</a></li>
                    </menu>
                  </li>
                </menu>
              )}
            </li>
          </menu>
        </li>
      </menu>
    </nav>
  );
};

export default Deep;
